import React, {Component} from 'react';
import { Row } from 'react-bootstrap';
import { Col } from 'react-bootstrap';
import {InputGroup, Button, Form, FormControl} from 'react-bootstrap';
import "../../styles/register.css";

export class Register extends Component{
    constructor(props){
        super(props);
    }

    render(){
        return(
            <Form id="sign-up-form">
                <Form.Group controlId="formBasicEmail">
                    <Form.Label>Sign-up</Form.Label>
                    <Form.Control id="email-input" type="email" placeholder="Enter email" />
                    <Form.Text className="text-muted">
                        We'll never share your email with anyone else.
                    </Form.Text>
                    <Form.Control id="password-input" type="password" placeholder="Password" />
                </Form.Group>

                <Form.Group controlId="formBasicPassword">
                    <Form.Label>Password</Form.Label>
                    <Form.Control id="password-input" type="password" placeholder="Password" />
                    <Form.Text id="passwordHelpBlock" muted>
                        Must be 8-20 characters long.
                    </Form.Text>
                </Form.Group>
                <Form.Group controlId="formBasicCheckbox">
                    <Form.Check type="checkbox" label="Agree to terms and conditions" />
                </Form.Group>
                <Button id="sign-up-button" variant="primary" type="submit">
                    Sign-up
                </Button>
            </Form>
        )
    }
}
